import {Link} from 'react-router-dom';

export const Navbar= () => {
    return (

      <nav className='nav-wrapper grey darken-2'>
      	<div className='container'>
      		<Link to='/' classNmae='brand-logo'>MarioPlan</Link>
      	</div>
      </nav>

    );
  }
